import Header from './Header';
import Photographes from './Photographes';
import Banner from './Banner';
import Photograph from './Photograph';

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="App">
      </div>
      <Switch>
        <Route exact path="/">
          <Header />
          <Photographes />
        </Route>
        <Route path='/profile/:profileId'>
          <Banner />
          <Photograph />
        </Route>
        </Switch>
    </Router>
  );
}

export default App;
